//=======================================================================================
Blueprint_Book PR_Burn_Prod_Green_AS_IS::build()
{
    auto res = Blueprint_Book::do_import( tmpl() );

    auto iron   = coal_prod( Item::Named::iron_ore(),   Item::Named::iron_plate() );
    auto steel  = coal_prod( Item::Named::iron_plate(), Item::Named::steel_plate() );
    auto copper = coal_prod( Item::Named::copper_ore(), Item::Named::copper_plate() );

    res.assign( PR_Trains_V2::receive_1L_6_wooden_chests(Item::Named::coal()), 2);
    res.assign( iron,   3 );
    res.assign( steel,  4 );
    res.assign( copper, 5 );

    return res;
}
//=======================================================================================
BluePrint PR_Burn_Prod_Green_AS_IS::coal_prod( Item from, Item to )
{
    static auto tmpl_ = BluePrint::do_import( coal_prod_copper() );
    static auto ore   = Item::Named::copper_ore();
    static auto plate = Item::Named::copper_plate();
    auto res = tmpl_;

    res.icons.set( 1, Item::get("steel-furnace") );
    res.icons.set( 2, Item::Named::train_stop() );
    res.icons.set( 3, from );
    res.icons.set( 4, to );

    res.remove_field( Item::get("wooden-chest"), "bar" );

    res.arithmetic_combinators_replace_in_out( ore, from );
    res.arithmetic_combinators_replace_in_out( plate, to );

    res.constant_combinators_replace( ore, from );
    res.constant_combinators_replace( plate, to );

    auto dcombs = res.find( Item::get(names::decider_combinator) );
    for ( auto o: dcombs )
    {
        Decider_Combinator comb{ o.toObject() };
        // It is receive combinator
        if ( comb.first_signal_name() == ore.name )
        {
            comb.constant( 12 * 7 * from.stack_size );
            comb.first_signal( from );
        }
        // It is send combinator
        if ( comb.first_signal_name() == plate.name )
        {
            comb.constant( 40 * to.stack_size );
            comb.first_signal( to );
        }
        o = comb.obj;
    }

    res.locomotives_init_fuel_coal( 7 );
    res.set_burner_inserters_stack_size_1();

    res.train_stops_replace( ore, from );
    res.train_stops_replace( plate, to  );

    res.schedules.replace( 0, plate, to );

    return res;
}
